import React from 'react';
import StaysData from '../../stays.json'
import StaysList from '../Stays/Stays';

export default function Filter() {
    const city = 'Helsinki';
    let data = [StaysData];
    return(
        <div>
            <div className="Filter-search">
                <div className="Filter-location">
                    <p>Location</p>
                    <p>{data.city}</p>
                    <p>{data.country}</p>
                </div>
                <div  className="Filter-guest">
                    <p>Guest</p>
                    <p>Add guest</p>
                </div>
                <button/>
            </div>
            <StaysList 
            city={city}
            data={data} />
        </div>
    )
}
